'''Greengrocers''' are men that run [[vegetable shops]] and own [[vegetable stalls]] on [[Miscellania]] and [[Etceteria]]. One can be found in each of the island's markets.

Greengrocers sell items such as [[garlic]], [[potato]]es, [[tomato]]es, and [[cabbage]]s. Their market stalls can also be stolen from at level 2 [[Thieving]]. As with all stall owners, if stolen from, they will not trade with the players for approximately 15 minutes. If spoken to, they will call for the nearby level 1 guards to attack. Stealing from this stall will also decrease your popularity with the citizens of the islands, which in turn makes the [[Managing Miscellania|kingdom management options]] less effective.

